description:
Being a spy will mean you end up making enemies, as Agent 327 finds out when Kwaitis dictator, Doctor Papa, start a diabolical plan to both get weapons to figth the rebels threatening his rule, AND get revenge over Agent 327.
Luckily, Agent 327 are joined by the Swiss female agent, Olga Lawina, his old pal Carl Sorge, AND the mechanical shark Bruce, but will that be enough to save him...or are female agents more trouble than they are worth?

Find out in the new episode of Agent 327 - The Case of the Sunday Child.
